    data: |
      SELECT DISTINCT - - ( + - col0 ) + - 20 AS col1 FROM tab2 WHERE ( - col1 + col2 NOT BETWEEN + col2 + 90 AND + col0 + + col0 + + - 70 );
  - name: tab2

outputs:
  - name: q2675.out
    data: |
      -66
      -84
      -95
